   [75]={next_id=76, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="阿尔戈说着，切换了一段音频，先是一阵沉闷的沙沙声，然后你听到了一个温柔的女声和一个稳重的男声。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_104.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [76]={next_id=77, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="西娜卡，我的女儿，这段音频是在我和你的爸爸在你刚出生时录给你的，作为你的十五岁生日礼物。\n我们是第一次当爸爸和妈妈，请你原谅这两个菜鸟做得不好的地方。\n西娜卡，代表着幸福和希望的女孩子，自由和放心地去长大吧。\n嗯……这是两个笨蛋第一年想要对你说的话，等明年的这一天，我们还会有更多的话说给你听。\n生日快乐，小西娜卡。\n生日快乐，我的女儿。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_104.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, page_show_effect={ 0.20, 0, 5, 0, 0.00, 0.00, 0.00, 0.00, 863.00, 291.00, 1.00, {}, {}}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
